import {useState, useEffect} from "react"

export default function Quizview(){
    interface Quiz {
        id:number;
        username: string;
        name: string;
        key: string;
      }
    const [quizs,setQuizs] = useState<Quiz[]>([])
    useEffect(
        ()=>{
            const getresult = async () => {
                fetch("/quiz")
                .then(response =>{
                    console.log(response)
                    return response.json()
                })
                .then((result:Quiz[])=>{
                    setQuizs(result)
                })
            }
            getresult();
        }
    ,[])
    return(
        <div className="quiz-container">
            {quizs.map(function(quiz:Quiz){
                return (
                    <div className="quiz-element" key={quiz.id}>
                        <div className="title">{quiz.name}</div>
                        <div className="madeBy">By {quiz.username}</div>
                    </div>
                )
            })}
        </div>
    )
}
